import React, { useState, useEffect } from "react";
import Axios from "axios";

export default function Cards() {
  useEffect(() => {
    Axios.get("http://localhost:3001/cards").then((res) => {
      console.log(res.data.list);
    });
  }, []);

  return (
    <div>
      <h1>Blog Cards</h1>
    </div>
  );
}
